@ozjimbob I agree on the "traumatic" part.

{tcltk} is built-in to #RStats but I've never seen anyone use it in the wild!

It doesn't help that the only documentation appears to be function 'man' pages in R itself.

@camjpatrick The R bindings to heavyweight GUI toolkits seem to be abandoned.  e.g. {qtbase} {gwidgets} {gtk2}

I'm guessing that the maintenance burden is high, cross system compatability is an issue, and documenting the interface in a clear way for R uses could be a real challange

